import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { User, Award, Activity, PieChart, Star, LogOut } from 'lucide-react';

const ProfilePage = () => {
  const [stats, setStats] = useState({ total: 0, avgPuan: 0, topBrand: '-' });
  const userName = localStorage.getItem('user_name') || 'Misafir Kullanıcı';

  useEffect(() => {
    const fetchStats = async () => {
      try {
        const res = await axios.get('http://localhost:8000/api/history');
        if (res.data.length > 0) {
          const total = res.data.length;
          const avg = Math.round(res.data.reduce((acc, curr) => acc + curr.puan, 0) / total);
          const top = res.data.sort((a, b) => b.puan - a.puan)[0].brand_name;
          setStats({ total, avgPuan: avg, topBrand: top });
        }
      } catch (e) { console.error(e); }
    };
    fetchStats();
  }, []);

  const handleLogout = () => {
    localStorage.clear();
    window.location.href = "/";
  };

  return (
    <div className="p-12 lg:p-20 min-h-screen bg-[#F9FAFB]">
      <div className="flex items-center justify-between mb-16">
        <div className="flex items-center gap-6 text-manrope">
          <div className="w-24 h-24 rounded-[2.5rem] bg-gradient-to-br from-[#10B981] to-[#3B82F6] flex items-center justify-center text-white shadow-2xl">
            <User size={48} />
          </div>
          <div>
            <h1 className="text-4xl font-black text-gray-900">{userName}</h1>
            <p className="text-[#10B981] font-bold uppercase tracking-widest text-sm mt-1">Premium Analist</p>
          </div>
        </div>
        <button onClick={handleLogout} className="flex items-center gap-2 px-6 py-3 rounded-2xl border-2 border-red-50 text-red-500 font-bold hover:bg-red-50 transition-all font-manrope">
          <LogOut size={20} /> Oturumu Kapat
        </button>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-3 gap-8 mb-12">
        <div className="p-8 bg-white rounded-[2.5rem] shadow-sm border border-gray-100">
          <Activity className="text-[#10B981] mb-4" size={32} />
          <p className="text-gray-400 font-bold uppercase text-xs tracking-widest">Toplam Analiz</p>
          <h3 className="text-4xl font-black text-gray-900 mt-2 font-manrope">{stats.total}</h3>
        </div>
        <div className="p-8 bg-white rounded-[2.5rem] shadow-sm border border-gray-100">
          <PieChart className="text-[#3B82F6] mb-4" size={32} />
          <p className="text-gray-400 font-bold uppercase text-xs tracking-widest">Ortalama Puan</p>
          <h3 className="text-4xl font-black text-gray-900 mt-2 font-manrope">%{stats.avgPuan}</h3>
        </div>
        <div className="p-8 bg-white rounded-[2.5rem] shadow-sm border border-gray-100">
          <Award className="text-orange-500 mb-4" size={32} />
          <p className="text-gray-400 font-bold uppercase text-xs tracking-widest">En İyi Marka</p>
          <h3 className="text-4xl font-black text-gray-900 mt-2 truncate font-manrope">{stats.topBrand}</h3>
        </div>
      </div>

      <div className="p-10 bg-black rounded-[3rem] text-white overflow-hidden relative shadow-2xl">
        <div className="relative z-10 font-manrope">
          <div className="flex items-center gap-3 mb-6 text-[#10B981]">
            <Star size={24} fill="currentColor" />
            <h4 className="font-bold uppercase tracking-widest">Başarı Seviyesi</h4>
          </div>
          <h2 className="text-3xl font-bold mb-4">Doğa Koruyucusu</h2>
          <p className="text-gray-400 leading-relaxed max-w-md">
            Yaptığınız analizlerle sürdürülebilir markaların fark edilmesine katkı sağlıyorsunuz. 
          </p>
        </div>
        <div className="absolute right-[-10%] bottom-[-20%] w-64 h-64 bg-[#10B981] opacity-20 blur-[80px] rounded-full" />
      </div>
    </div>
  );
};

export default ProfilePage;
